import { NavLink } from "react-router-dom";

const Navigation = ({ links }) => {
  const getLinks = Object.keys(links).map((key) => {
    console.log("Key: ", key);
    <li>
      <NavLink key={key} to={links[key]}>
        {key}
      </NavLink>
    </li>;
  });

  return (
    <div className="main-nav">
      <ul>{getLinks}</ul>
    </div>
  );
};

export default Navigation;
